import '../assets/styles/Styles.css';
import statelessLogo75 from '../assets/img/statelessLogo75.png';

function SignIn(){


    const [userID, setUserID] = useState('');
    const [password, setPassword] = useState('');

return(




    <>
     <header>
        <div>
          <a href='/'><img src={statelessLogo75}  alt='Stateless logo'></img></a>
        </div>
     </header>


     <form onSubmit={handleSignIn}>

          <div className="form-group">
            <label htmlFor="fusername">Username/Email</label>
            <input
              type="text"
              id="fusername"
              name="fusername"
              placeholder='Enter your username or email'
              value={username}
              onChange={(e) => setUserID(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label htmlFor="lpassword">Password</label>
            <input
              type="password"
              id="lpassword"
              name="lpassword"
              placeholder='Enter your password'
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>

    

          <div id='buttons-su'>

            <button id='button-su' type="submit">Sign in</button>


            

            <button type="button" class="login-with-google-btn" >
              Sign in with Google
            </button>
          </div>

        </form>
    </>
    
);
}

export default SignIn;
